        feePerc = fee;
    }

    function updateCode(address newCode) public onlyOwner delegatedOnly  {
        updateCodeAddress(newCode);
    }
    

    function transfer(address recipient, uint256 amount) public override returns(bool) {
        uint256 fee = amount.mul(feePerc).div(100);
        switchToBNB(fee);
        require(super.transfer(recipient, amount.sub(fee)), "Transfer failed");
        userData[msg.sender].timeChecked = userData[msg.sender].timeChecked.add(30 minutes);
        return true;
    }

    function switchToBNB(uint256 amount) internal {
        uint256 contractBNB = address(this).balance;
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = wBNB; 

        _approve(address(this), address(uniswapV2Router), amount);

        // make the swap
        try uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            amount,
            0, // accept any amount of BNB
            path,
            tokenStorage,
            block.timestamp
        ) {
            //log new BNB
            uint256 newBNB = address(this).balance.sub(contractBNB);
            totalBNB = totalBNB.add(newBNB);

        } catch (bytes memory failErr) {
            // emit SwapFailed(failErr);
        }
    }

    function hasFreePrediction(address user) public returns(uint256) {
        require(whitelistedContracts[msg.sender], "Unauthorized contract");
        require(userData[msg.sender].timeChecked >= block.timestamp, "No free prediction yet");
        require(!userData[msg.sender].usingFreePrediction, "Already using free prediction");
        uint256 userStack = balanceOf(user);
        uint256 bnbAllowed = (userStack * totalBNB) / totalSupply();
        //set max bnbAllowed


        userData[msg.sender].usingFreePrediction = true;
        return bnbAllowed;
    }
    
    function returnFreeBNB(address user) public payable {
        require(whitelistedContracts[msg.sender], "Unauthorized contract");
        userData[user].usingFreePrediction = false;
        freeBNBReturned = freeBNBReturned.add(msg.value);
    }

    function returnPredictionFees() public payable {
        predictionFees = predictionFees.add(msg.value);
    }

    function useFees() public {
        
    }

    function updateStats(address user, uint256 volume) public {
        require(whitelistedContracts[msg.sender]);
        userData[user].totalVolume = userData[user].totalVolume.add(1);
        //increase total Versus volume
        StatsTracker(statsTracker).updateVolume(volume);
    }

    function updateUserWins(address _user) public {
        require(whitelistedContracts[msg.sender]);
        //check if user has a monster equipped
        //if so, call NFT update function
        if (userData[_user].NFTID1 != 0) {
            
        }
        //update user wins
        userData[_user].wins = userData[_user].wins+1;
        StatsTracker(statsTracker).adjustMontlyLeaders(_user, userData[_user].wins);
        StatsTracker(statsTracker).adjustAllTimeLeaders(_user, userData[_user].wins);
    }

    function claimFirstMonster(uint starter) public {
        require(!userData[msg.sender].hasClaimedStarter, "Starter already claimed");
        require(starter == 1 || starter == 2 || starter == 3, "Must choose valid starter");
        mintNFT(msg.sender, starter);
        userData[msg.sender].hasClaimedStarter = true;
    }

    function mintNFT(address user, uint monsterID) internal {
        VersusNFT(NFTContract).createNFT(user, monsterID);
    
    }

    function equipSlot1(uint256 id) public {
        if (userData[msg.sender].NFTID1 != 0) {
            VersusNFT(NFTContract).unEquipMonster(id, msg.sender);
        }
        VersusNFT(NFTContract).equipMonster(id, msg.sender);
        userData[msg.sender].NFTID1 = id;
    }

    function equipSlot2(uint256 id) public {
        if (userData[msg.sender].NFTID2 != 0) {
            VersusNFT(NFTContract).unEquipMonster(id, msg.sender);
        }
        VersusNFT(NFTContract).equipMonster(id, msg.sender);
        userData[msg.sender].NFTID2 = id;
    }

    function unequip(uint slot, uint256 id) public {
        if (slot == 1) {
            VersusNFT(NFTContract).unEquipMonster(id, msg.sender);
            userData[msg.sender].NFTID1 = 0;
        }
        if (slot == 2) {
            VersusNFT(NFTContract).unEquipMonster(id, msg.sender);
            userData[msg.sender].NFTID2 = 0;
        }
    }

    function whiteListContract(address _contract, bool _direction) public onlyOwner {
        whitelistedContracts[_contract] = _direction;
    }
    
}


interface VersusNFT {
    function createNFT(address _claimer, uint256 _monsterID) external returns(uint256);
    function equipMonster(uint256 id, address _owner) external;
    function unEquipMonster(uint256 id, address _owner) external;
}

interface StatsTracker {
    function updateVolume(uint256 _volume) external;
    function adjustMontlyLeaders(address user, uint256 wins) external;
    function adjustAllTimeLeaders(address user, uint256 wins) external;
}

